// login.jsx

import { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { login, verifyEmail, getPassword } from '../Services/user'; // Update import statement
import { useDispatch } from 'react-redux';
import { loginAction } from '../feature/userSlice';

function LoginUser() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [verificationCode, setVerificationCode] = useState('');

  const navigate = useNavigate();
  const dispatch = useDispatch();

  const onLogin = async () => {
    // Client side validation
    if (email.length === 0) {
      alert('Enter email');
    } else if (password.length === 0) {
      alert('Enter password');
    } else {
      try {
        // Verify email
        await verifyEmail(email);

        // If email is verified, get password
        const passwordResult = await getPassword(email, verificationCode);

        if (passwordResult['status'] === 'success') {
          const { password } = passwordResult['data'];

          // Now login with the retrieved password
          const loginResult = await login(email, password);

          if (loginResult['status'] === 'success') {
            const { fullname, token } = loginResult['data'];
            sessionStorage.token = token;
            sessionStorage.fullname = fullname;
            dispatch(loginAction());
            navigate('/home');
          } else {
            alert('Invalid email or password');
          }
        } else {
          alert('Invalid verification code');
        }
      } catch (error) {
        alert('Error: ' + error.message);
      }
    }
  };

  return (
    <div>
      <h2 className="page-title">Login</h2>
      <div className="row">
        <div className="col"></div>
        <div className="col">
          <div className="form">
            <div className="mb-3">
              <label htmlFor="">Email</label>
              <input
                onChange={(e) => setEmail(e.target.value)}
                type="email"
                className="form-control"
              />
            </div>
            <div className="mb-3">
              <label htmlFor="">Password</label>
              <input
                onChange={(e) => setPassword(e.target.value)}
                type="password"
                className="form-control"
              />
            </div>
            <div className="mb-3">
              <label htmlFor="">Verification Code</label>
              <input
                onChange={(e) => setVerificationCode(e.target.value)}
                type="text"
                className="form-control"
              />
            </div>
            <div className="mb-3">
              <div>
                Don't have an account yet?{" "}
                <Link to="/register">Register here</Link>
              </div>
              <button onClick={onLogin} className="mt-2 btn btn-success">
                Login
              </button>
            </div>
          </div>
        </div>
        <div className="col"></div>
      </div>
    </div>
  );
}

export default LoginUser;



